import React from 'react';

const Header = props =>{

    return(
    <React.Fragment>
        <header>
            <ul>
                <li>Home</li>
                <li>About US</li>
                <li>Contact US</li>
                <li>Blog</li>
            </ul>
        </header>
    </React.Fragment>
    )
}
export default Header;
